      <p className='center'>15</p>
     </div>
     <div className='p-1'></div>
     <div className='Grid'>
      <p className='btn' onClick={console.log("15")}>15</p>
     </div>
      
    </div>
    <br />  */}
    {
     dum3.map(
      seats => (
       <tr id='seats.id'></tr>
     
      )
     )
    }
   </div>
  )
}

export default Practice
